                 style={{width:"5px",boxShadow:" 0 2px 0px 0 rgba(0, 0, 0, 0.16), 0 2px 2px 0 rgba(0, 0, 0, 0.12)"}}
                  getValue={this.getValue}
                  min={300}
                  max={1500}
                  step={20}
                /> <br/>  


