            onClick={() => this.all()}
            >All</MDBBtn>

             <MDBBtn  size="sm"color="" style={{boxShadow:" 0 2px 0px 0 rgba(0, 0, 0, 0.16), 0 2px 2px 0 rgba(0, 0, 0, 0.12)",marginBottom:"12px"}}
            onClick={() => this.knit()}
             >Knitwear</MDBBtn>

            <br/> 
            <MDBBtn  size="sm"color="" style={{boxShadow:" 0 2px 0px 0 rgba(0, 0, 0, 0.16), 0 2px 2px 0 rgba(0, 0, 0, 0.12)",marginBottom:"12px"}}
           onClick={() => this.jeans()}
