           <MDBCardBody>
             <MDBCardText>
             Tank Top
               <br/>
               KSH 300 
             </MDBCardText>

             <MDBNavLink to={{pathname:"/more",
               state: { url: this.state.url3,H:"Tank Top",d:"Flowy V-neck camisole with spaghetti straps.",C:"300"} }} >
               <MDBBtn color="light-blue" size="sm" >
